import { useState, useEffect } from "react";
import BlogList from "./BlogList";
import useFetch from "./useFetch";

const Home = () => {
  const {
    data: exams,
    isPending,
    error,
  } = useFetch("http://localhost:8000/exams");

  return (
    <div className="home">
      {error && <div>{error}</div>}
      {isPending && <div>Loading...</div>}
      {exams && <BlogList exams={exams} title="Active Exams" />}
      {exams.filter((exam) => {
        exam.id == 1;
      })}
    </div>
  );
};

export default Home;
